import { DrinkWrapper, Price, Title } from './Drink.styled';

export default function Drink({ title, price }) {
  return (
    <DrinkWrapper>
      <Title flex justify="center" align="center">
        {title}
      </Title>
      <Price flex justify="center" align="center">
        {price}
      </Price>
    </DrinkWrapper>
  );
}
